import Button from 'react-bootstrap/Button';


function ButtonsRow() {
return (
    <div>
        <div>
            <span style={{ fontSize: "2em"}}>
                <button type="button" class="btn btn-primary" style={{ marginRight: "10px" }}>Buy</button>
                <button type="button" class="btn btn-primary" style={{ marginRight: "10px" }}>Primary</button>
                <button type="button" class="btn btn-primary">Primary</button>
            </span>
        </div>
    </div>
);
}


export default ButtonsRow;
